import React from 'react'

import Layout from '../components/layout'
import Card from '../components/card'

function HomePage() {
    return (
        <Layout>
            <Card
                name="Adem ilter"
                text={`bu eğitim önüne logo ekleyerek sponsor olmak isteyen şirketler katıl butonuna tıklayabilir Right-facing fistLeft-facing fist siz motivasyon sağlayın, sektör daha fazla türkçe içerikle zenginleşsin`}
            />
        </Layout>
    )
}

export default HomePage
